description:
How It's Made Collection 2

Technology Documentary hosted by Brooks T Moore, published by Discovery Channel in 2008 - English narration


Information
------------------------------

How It's Made Collection 2
Each day we use hundreds of products throughout our routines, never stopping to think about where those products come from and how they were manufactured. How It's Made shows you the outrageous behind the ordinary in the step-by-step processes of building, crafting and creating our most common products.


1)  Part 1 
Disc 1
Part 1 pre-inked stamps, cranberries, cotton yarn and road signs
Part 2 combination locks, pottery, recreational vehicles and erasers
Part 3 wheel loaders, vegetable oil, hand tools and cotton swabs
Part 4 temporary metal fences, expanded polystyrene products and hard candies,
Part 5 horse-drawn carriages, artificial eyes, and dog and cat food, mirrors
Part 6 yogurt, candles, neon signs and bookbindings
Part 7 fresh-cut flowers, adhesive tape, tofu and lottery tickets
Part 8 prepared mustard, violins, nuts and bolts, and toilet paper
Part 9 inflatable watercraft, couscous, modelling dough and wicker product

2)  Part 2 
Disc 2
Part 10 wind generators, PVC gloves, and thermo-formed glass and fire trucks
Part 11 car radiators, hatchery chicks, phyllo pastry and cross-country skis
Part 12 electric baseboard heaters, moulded pulp container
Part 13 fighter boots, garden tools, automated machines and gypsum board
Part 14 plastic bottles &amp; jars, mail, eggs, and handcrafted wooden pens
Part 15 plastic injection moulds, automotive oil filters, filing cabinets
Part 16 high-precision cutting tools, stained glass, semi-trailers
Part 17 conga drums, metal plating and buttons
Part 18 grinding wheels, compost, window blinds and milk

3)  Part 3 
Disc 3
Part 19 brushes &amp; push brooms, blackboards, smoked salmon and zippers
Part 20 3D commercial signs, hardwood floors, corrugated polyethylene pipe
Part 21 ceramic tiles, nuts, steel forgings and skateboards
Part 22 car engines, flour, recliners and envelopes
Part 23 plastic cups &amp; cutlery, special effects makeup, gold and harps
Part 24 countertop laminate, frozen treats, children's building blocks and detergents
Part 25 architectural moldings, pulleys, industrial rubber hose and sheet vinyl flooring
Part 26 putty knives, garage doors, electric motors and wool

